import React from "react";
import '../css/slide.css';

export function Slide() {
    return (
        <div className="slide_container">
            <div className="slide">
            </div>
            <div className="slide">
            </div>
            <div className="slide">
            </div>
            <div className="slide">
            </div>
            <a class="prev" onClick={plusSlides(-1)}>&#10094;</a>
            <a class="next" onClick={plusSlides(1)}>&#10095;</a>
            <div className="numbers">
                <span class="number" onClick={currentSlide(1)}>1</span>
                <span class="number" onClick={currentSlide(2)}>2</span>
                <span class="number" onClick={currentSlide(3)}>3</span>
            </div>
        </div>
    );
}
